    {
      id: 'e1',
      title: 'Stationaries',
      amount: 1024.12,
      date: new Date(2023, 7, 14),
    },
    { 
      id: 'e2', 
      title: 'Travel Expense',
      amount: 25000, 
     date: new Date(2023, 2, 12) 
    },
    {
      id: 'e3',
      title: 'Groceries',
      amount: 11000,
      date: new Date(2023, 2, 28),
    },
